import React, { Component } from 'react'

//Material UI
import Accordion from '@material-ui/core/Accordion';
import AccordionDetails from '@material-ui/core/AccordionDetails';
import AccordionSummary from '@material-ui/core/AccordionSummary';
import Typography from '@material-ui/core/Typography';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

class privacyPolicy extends Component {
    render() {
        return (
            <div className="privacyPolicy">
                <h3>Complaints</h3>
                <p>If you have complaints regarding the way your protected health information was handled, you may submit a complaint in writing to our office. You will not be retaliated against in any manner for a complaint.</p>
            </div>
        )
    }
}

export default privacyPolicy
